import { ReciepeService} from '../app/Service/reciepe.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent 
{
  title = 'recipeFront';
  recipe: any;
  constructor(private dataService:ReciepeService ){}
  ngOnInit() 
  {
    this.dataService.getAllRecipes().subscribe((response) => {
      this.recipe = response;
    });      
  }
}
